INSERT INTO `table_product_list` (`id`, `noibat`, `menu`, `tenkhongdauvi`, `tenkhongdauen`, `noidungen`, `noidungvi`, `motaen`, `motavi`, `tenen`, `tenvi`, `photo`, `options`, `stt`, `hienthi`, `type`, `ngaytao`, `ngaysua`, `page`) VALUES
(17, 1, 0, 'trai-cay-trong-nuoc', '', '', '&lt;p&gt;Trong điều kiện “đất chật người đông” hiện nay, người dân thường có xu hướng lựa chọn sống trong các khu chung cư. Tuy nhiên vì đây cũng là nơi sinh sống của cả gia đình nên việc thiết kế nội thất chung cư cũng nên được chú trọng. Khác với nhà ở, thiết kế nội thất chung cư cũng có nhiều sự khác biệt hơn và chú trọng nhất vào sự tiện dụng. Các căn hộ thường có diện tích khá nhỏ vì thế việc bố trí và thiết kế càng hợp lý thì bạn hoàn toàn có thể đem đến không gian rộng rãi, ấm áp và đầy hạnh phúc cho cả gia đình&lt;/p&gt;\r\n', '', 'Cùng tham khảo các sản phẩm của chúng tôi dưới dây', '', 'Trái cây trong nước', 'traicaygiangsan135812121t507-5535.jpg', '{\"p\":\"traicaygiangsan135812121t507-5535.jpg\",\"w\":264,\"h\":263,\"m\":\"image\\/jpeg\"}', 1, 1, 'san-pham', 1612773394, 1623726025, 1),
(18, 1, 1, 'trai-cay-nhap-khau', '', '', '', '', 'Chúng tôi cung cấp thùng carton uy tín - chất lượng', '', 'Trái cây nhập khẩu', 'about-5578.png', '{\"p\":\"about-5578.png\",\"w\":381,\"h\":379,\"m\":\"image\\/png\"}', 1, 1, 'san-pham', 1612773442, 1623725993, 8);
