INSERT INTO `table_static` (`id`, `photo`, `photo1`, `options`, `tenkhongdauvi`, `tenkhongdauen`, `noidungen`, `noidungvi`, `motaen`, `motavi`, `tenen`, `tenvi`, `taptin`, `type`, `hienthi`, `ngaytao`, `ngaysua`) VALUES
(1, 'about-7003.png', 'about1-3014.jpg', '{\"p\":\"about-7003.png\",\"w\":556,\"h\":463,\"m\":\"image\\/png\"}', 'gioi-thieu-anh-tuan-windown', '', '', '', '', '&lt;p&gt;&lt;strong&gt;“ Tự Hào Phát Triển Từ Một Vị Trí Đã Được Khẳng Định ”&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Với phương châm &quot;Sắt thép chất lượng cho mọi công trình&quot;, đội ngũ Cán bộ công nhân viên Công ty chúng tôi không ngừng học hỏi, nghiên cứu thị trường nhằm đáp ứng kịp thời các nhu cầu của khách hàng. Giá cả cạnh tranh, chất lượng tiêu chuẩn, thanh toán linh hoạt cũng như chăm sóc khách hàng tận tình. Để phục vụ quý khách hàng được tốt hơn và thuận lợi trong việc tra cứu các chủng loại sắt thép. Xin chân thành cảm ơn quý khách.&lt;/p&gt;\r\n', '', 'GIỚI THIỆU ANH TUẤN WINDOWN', '', 'gioi-thieu', 1, 1607934417, 1624606676),
